    //引导
    showGuide(name, X, Y) {
        this.guide = this.add.image(X, Y, name).setOrigin(0, 0)
        this.guide.scaleX = 0.5
        this.guide.scaleY = 0.5
        // rotation: -0.15,
        this.guide.setInteractive();


        this.tweens.add({
            targets: [this.guide],
            // rotation: -0.15,
            //  scaleX: 1.05,
            // scaleY: 1.02,
            x: X,
            duration: 200,
            callbackScope: this,
            onComplete: function (tween) {
                // b1.visible = false;
                // b1.destroy();
                this.tweens.add({
                    targets: [this.guide],
                    // rotation: -0.15,
                    //  scaleX: 1,
                    //  scaleY: 1,
                    x: X + 20,
                    duration: 200,
                    callbackScope: this,
                    onComplete: function (tween) {
                        // b1.visible = true;
                    }
                });
            }
        })
        this.inter_guide = setInterval(() => {
            this.tweens.add({
                targets: [this.guide],
                // rotation: -0.15,
                //  scaleX: 1.05,
                // scaleY: 1.02,
                x: X,
                duration: 200,
                callbackScope: this,
                onComplete: function (tween) {
                    // b1.visible = false;
                    // b1.destroy();
                    this.tweens.add({
                        targets: [this.guide],
                        // rotation: -0.15,
                        //  scaleX: 1,
                        //  scaleY: 1,
                        x: X + 20,
                        duration: 200,
                        callbackScope: this,
                        onComplete: function (tween) {
                            // b1.visible = true;
                        }
                    });
                }
            })
        }, 500);
    }

     //点击门抖动，引导
    clickDoor() {
        //点击门抖动，出现锁
        this.door.setInteractive();
        this.door.on('pointerdown', function (pointer) {
            // 门抖动
            this.tweens.add({
                targets: [this.door],
                // rotation: -0.15,
                scaleX: 1.05,
                // scaleY: 1.02,
                duration: 100,
                callbackScope: this,
                onComplete: function (tween) {
                    // b1.visible = false;
                    // b1.destroy();
                    this.tweens.add({
                        targets: [this.door],
                        // rotation: -0.15,
                        scaleX: 1,
                        scaleY: 1,
                        duration: 100,
                        callbackScope: this,
                        onComplete: function (tween) {
                            // b1.visible = true;
                        }
                    });
                }
            })
            if (count1 == 0) {
                //指示门的箭头消失
                this.guide.visible = false
                clearInterval(this.inter_guide)
                setTimeout(() => {
                    if (flag == true) {
                       //水龙头抖动
                       this.showSwitch()
                       this.clickSwitch()
                    }

                }, 0);
            }
            count1 = 1

            //出现锁
            var locked = this.add.image(140, 390, 'locked')
            locked.alpha = 0;

            this.tweens.add({
                targets: [locked],
                // rotation: -0.15,
                alpha: 1,
                scaleX: 1.05,
                scaleY: 1.02,
                duration: 500,
                callbackScope: this,
                onComplete: function (tween) {
                    // b1.visible = false;
                    // b1.destroy();
                    this.tweens.add({
                        targets: [locked],
                        // rotation: -0.15,
                        alpha: 0,
                        scaleX: 1,
                        scaleY: 1,
                        duration: 500,
                        callbackScope: this,
                        onComplete: function (tween) {
                            // b1.visible = true;
                        }
                    });
                }
            })

        }, this)
    }

    // 水龙头闪烁
    showSwitch(){
        this.switch_a.visible = 1
        this.switch_interval = setInterval(() => {
            setTimeout(() => {
                this.switch_a.visible = 0
            }, 400);
            setTimeout(() => {
                this.switch_a.visible = 1
            }, 800);
        }, 800);
    }
    
    //狗闪烁
    showDog() {
        setInterval(() => {
            setTimeout(() => {
                this.dog2.visible = true
            }, 800);
            setTimeout(() => {
                this.dog2.visible = false
            }, 1600);
        }, 1600);
    }

    //点击水龙头，水漫出
    clickSwitch(){
        this.switch_a.on('pointerdown',()=>{
            setTimeout(() => {
                clearInterval(this.switch_interval)
                this.switch_a.scaleX = 0
                this.switch_a.scaleY = 0
                this.switch_b.scaleX = 0
                this.switch_b.scaleY = 0
                this.sink_n.visible = 0
                this.sink_a.visible = 1
            }, 300);
            setTimeout(() => {
                this.sink_b.visible = 1
                this.showDog()
            }, 800);
            setTimeout(() => {
                this.sink_c.visible = 1
                this.key.visible = 1
                this.tweens.add({
                    targets:[this.key],
                    angle:150,
                    y:600,
                    duration:500,
                    callbackScope:this,
                    onComplete:()=>{
                        this.tweens.add({
                            targets:[this.key],
                            angle:90,
                            duration:100,
                            callbackScope:this,
                            onComplete:()=>{
                                this.clickKey()
                            }
                        })
                    }
                })
            }, 1200);
        },this)
        this.switch_b.on('pointerdown',()=>{
            setTimeout(() => {
                clearInterval(this.switch_interval)
                this.switch_a.scaleX = 0
                this.switch_a.scaleY = 0
                this.switch_b.scaleX = 0
                this.switch_b.scaleY = 0
                this.sink_n.visible = 0
                this.sink_a.visible = 1
            }, 300);
            setTimeout(() => {
                this.sink_b.visible = 1
                this.showDog()
            }, 800);
            setTimeout(() => {
                this.sink_c.visible = 1
                this.key.visible = 1
                this.tweens.add({
                    targets:[this.key],
                    angle:150,
                    y:600,
                    duration:500,
                    callbackScope:this,
                    onComplete:()=>{
                        this.tweens.add({
                            targets:[this.key],
                            angle:90,
                            duration:100,
                            callbackScope:this,
                            onComplete:()=>{
                                this.clickKey()
                            }
                        })
                    }
                })
            }, 1200);
        },this)
    }

    //点击钥匙，打开锁
